import React from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="relative min-h-screen font-[Poppins] overflow-hidden bg-gradient-to-br from-indigo-200 via-purple-200 to-pink-200">
      {/* Background video */}
      <video
        autoPlay
        loop
        muted
        playsInline
        className="absolute top-0 left-0 w-full h-full object-cover z-[-1]"
      >
        <source src="/video.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>

      {/* Content overlay */}
      <div className="relative z-10 min-h-screen flex flex-col items-center justify-center p-6 text-center backdrop-blur-md bg-white/60">
        <h1 className="text-5xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-pink-500 via-purple-500 to-indigo-500 mb-12 drop-shadow-lg">
          Welcome to Your Colorful Dashboard
        </h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 gap-6 w-full max-w-xl">
          {[
            { label: "Users", path: "/users", gradient: "from-blue-400 to-blue-600" },
            { label: "Products", path: "/products", gradient: "from-green-400 to-green-600" },
            { label: "Orders", path: "/orders", gradient: "from-yellow-400 to-yellow-600" },
            { label: "Admin", path: "/admin-login", gradient: "from-purple-400 to-purple-600" },
          ].map(({ label, path, gradient }) => (
            <button
              key={label}
              onClick={() => navigate(path)}
              className={`p-6 bg-gradient-to-r ${gradient} text-white text-xl rounded-xl shadow-xl hover:scale-105 transform transition duration-300`}
            >
              {label}
            </button>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
